import React from "react";
import PropTypes from "prop-types";

const Card = (props) => {
    return (

        <div className="Header">
            <div className="BookTitle">{props.name}</div>
        </div>

    );
};

Card.propTypes = {
    /**
     *  Name
     */
    name: PropTypes.string.isRequired
};

export default Card;
